import React, { Component } from 'react';
import './App.css';
import { Layout, Header, Navigation, Drawer, Content } from 'react-mdl';
import Main from './components/main';
import { Link } from 'react-router-dom';

class App extends Component {
  render() {
    return (
      <div className="demo-big-content">
    <Layout>
        <Header className="header-color" title={<Link style={{textDecoration: 'none', color: 'white'}} to="/">Home</Link>} scroll>
            <Navigation className="position">
                <Link to="/resume">About Me</Link>
                <Link to="/projects">Projects</Link>

            </Navigation>
        </Header>
        <Drawer title={<Link style={{textDecoration: 'none'}} to="/">Home</Link>}>
            <Navigation>
              <Link style={{color: 'Midnightblue' }}to="/resume">About Me</Link>
              <Link style={{color: 'Midnightblue' }}to="/projects">Projects</Link>

            </Navigation>
        </Drawer>
        <Content>
            <div className="page-content" />
            <Main/>
        </Content>
    </Layout>
</div>

    );
  }
}

export default App;
